import Vue from "vue";
import VueRouter from "vue-router";
import UsersDashboard from "../Users-Frontend/Components/UsersDashboard.vue";
import RolesDashboard from "../Users-Frontend/Components/RolesDashboard.vue";

import store from "@/store";

Vue.use(VueRouter);

const routes = [
  { path: "/Users", component: UsersDashboard },
  {
    path: "/Roles",
    component: RolesDashboard,
    beforeEnter: (to, from, next) => {
      const kunda = store.getters.isUserLogged;
      console.log(kunda);
      console.log(to);
      console.log(from);
      console.log(next);
    },
  },
];

const router = new VueRouter({
  routes,
});

export default router;
